} .has-danger { .form-control { border-color: $form-feedback-invalid-color; }
} Please note that this is a workaround, as there is yet no way to add an error class directly onto an input. However, there is an open issue on Simple Form: https://github.com/plataformatec/simple_form/pull/147 Once this feature is added, please remove the css. For the styling of the pull down date selectors or checkboxes, you need to write some wrappers, that you can add to the input element. It is best to create a separate config file for this. Once the issue https://github.com/plataformatec/simple_form/pull/1337 is done, you can also configure simple form with the command rails generate simple_form:install --bootstrap4. # config/initializers/simple_form_bootstrap.rb SimpleForm.setup do |config| config.wrappers :inline_date, tag: 'div', error_class: 'has-danger' do |b| b.use :html5 b.use :label, class: 'control-label' b.wrapper tag: 'div', class: 'form-inline row' do |ba| ba.use :input, class: 'form-control form-inline', wrap_with: { class: 'col-md-6' } ba.use :error, wrap_with: { tag: 'span', class: 'invalid-feedback' } ba.use :hint, wrap_with: { tag: 'p', class: 'help-block' } end end config.wrappers :inline_checkbox, tag: 'div', class: 'control-group', error_class: 'has-error' do |b| b.use :html5 b.wrapper tag: 'div', class: 'controls' do |ba| ba.use :label_input, wrap_with: { class: 'checkbox inline' } ba.use :error, wrap_with: { tag: 'span', class: 'help-inline' } ba.use :hint, wrap_with: { tag: 'p', class: 'help-block' } end end config.wrapper_mappings = { check_boxes: :inline_checkbox, date: :inline_date, datatime: :inline_date }
